import React, { useEffect, useRef, useContext, useState } from "react";
import "../../../Scss/Faq.scss";
import Head from "../../Items/HeaderGame";
import { Tab, Tabs, TabList, TabPanel } from "react-tabs";
import "react-tabs/style/react-tabs.css";
import Footer from "../../Firstpage/Footer.js";
import TestContext from "../../../Context/testContext";
import AuthContext from "../../../Context/Auth/authContext";

function useEffectSkipFirst(fn, arr) {
  const isFirst = useRef(true);
  useEffect(() => {
    if (isFirst.current) {
      isFirst.current = false;
      return;
    }
    fn();
  }, arr);
}

const FaqPage = () => {
  const testContext = useContext(TestContext);
  const authContext = useContext(AuthContext);
  const { CreateItemInUser } = testContext;
  const { user, login, isAuthenticated, err, logout } = authContext;
  const [active, setActive] = useState(1);

  return (
    <div className="FaqPage">
      <Head />
      <div className="secondHead"><h1>Frequently Asked Question</h1></div>
      <div className="MainControl">
        <Tabs>
          <TabList
            onClick={(e) => setActive(e.target.value)}
            className="header"
          >
            <Tab value={1} className={active == 1 ? "activeTab tab" : "tab"}>
              General
            </Tab>
            <Tab value={2} className={active == 2 ? "activeTab tab" : "tab"}>
              Warzone
            </Tab>
            <Tab value={3} className={active == 3 ? "activeTab tab" : "tab"}>
              Dota 2
            </Tab>
            <Tab value={4} className={active == 4 ? "activeTab tab" : "tab"}>
              Valorant
            </Tab>
            <Tab value={5} className={active == 5 ? "activeTab tab" : "tab"}>
              FIFA
            </Tab>
            <Tab value={6} className={active == 6 ? "activeTab tab" : "tab"}>
              Apex
            </Tab>
          </TabList>

          <TabPanel>
            <div className="Creater">
            <div className='CloseTicket'>

          <div className="MassageOpen">
            <details>
                <summary>
                    <div className="itemMas">
                        <div className="LongpartInfo"><h5>How to edit my profile and changing</h5></div>
                        <div className="partInfo partInfox"><h2>▼</h2></div>
                    </div>
                </summary>
                <div className='InfoTicket'>

                    <div className="FAQInfo">

                    </div>

                </div>
            </details>
            <details>
                <summary>
                    <div className="itemMas">
                        <div className="LongpartInfo"><h5>How to register in website?</h5></div>
                        <div className="partInfo partInfox"><h2>▼</h2></div>
                    </div>
                </summary>
                <div className='InfoTicket'>

                    <div className="FAQInfo">

                    </div>

                </div>
            </details>

            </div>
    </div>
            </div>
          </TabPanel>
          <TabPanel>2</TabPanel>
          <TabPanel>3</TabPanel>
          <TabPanel>4</TabPanel>
          <TabPanel>
            <h2>Any content 2</h2>
          </TabPanel>
        </Tabs>
      </div>
      <Footer />
    </div>
  );
};

export default FaqPage;
